import "./App.css";
import React from "react";
import Landingpage from "./Components/Landingpage/Landingpage";
import { Switch, Routes, Route } from "react-router-dom";

export default function App() {
    return (
        <div className="App">
            <Routes></Routes>
            <Route exact path="/">
                <Landingpage />
            </Route>
        </div>
    );
}
